description:
Kickboxing Kids

Sociopolitical Documentary hosted by Mary Ann Ochota, published by Channel 4 broadcasted as part of CH4 Unreported World series in 2014 - English narration


Information
------------------------------

Thai children as young as seven fight in the brutal sport of Muay Thai, knocking out their opponents with elbows, knees, feet and fists. It can leave the kids brain damaged, but adult gambling on these unpredictable fights is big business, and their families put enormous pressure on the kids to fight and win.
Reporter Mary-Ann Ochota and director Daniel Bogado follow 11-year-old Nat Thanarak, one of the best child boxers in the north of the country, as he prepares for the biggest match of his career so far, against a 12-year-old champion from another province. Nat will get a fee for the fight, but his chance of earning big money comes from gambling. His whole village has raised a stake to bet on him. If Nat wins, he'll get a cut.
There are more than 30,000 professional child fighters taking part in Muay Thai, which is considered one of the toughest martial arts in the world. Although they sometimes fight for a fee of as little as Ã‚Â£4, their winnings can make them breadwinners for their families and local heroes in their villages.

